        String[] strs = s26.split(" ");
        Set<String> set = new HashSet<>();
        StringBuilder sb = new StringBuilder();
        for (String str : strs) {
            if (str.equals("")) {
                continue;
            }
            if (str.startsWith("0")) {
                String ss = removeZero(str);
                set.add(ss);
                continue;
            }
            set.add(str);
        }
        return set.size();
    }

    public String removeZero(String str) {
        char[] arr = str.toCharArray();
        for (int i = 0; i < arr.length - 1; i++) {
            if (arr[i] != '0') {
                break;
            } else {
                arr[i] = ' ';
            }
        }
        StringBuilder sb = new StringBuilder();
        for (char c : arr) {
            if (c != ' ') {
                sb.append(c);
            }
        }
        System.out.println(sb.toString());
        return sb.toString();
    }
